import {Row} from './rows'
const app =() =>{
return(    
    <Table striped bordered hover>
    <thead>
      <tr>
        <th>#</th>
        <th>First Name</th>
        <th>Last Name</th>
        <th>Username</th>
      </tr>
    </thead>
    <tbody>
    {objects.map((object, i) => <ObjectRow obj={object} key={i} />)}
</tbody>
  </Table>
        
     
    );
}

export default app;
